import React from 'react'
import Navbar from '../../navbar/Navbar';
import { useState,useEffect } from 'react';

const KekkeiGenkai = () => {

    const [kekkeiGenkai,setKekkeiGenkai] = useState([]);

    useEffect(() =>{
        const fetchAllKekkeiGenkai = async () =>{
        try {
            const res = await axios.get("https://dattebayo-api.onrender.com/kekkeiGenkai");
            setKekkeiGenkai(res.data.kekkeiGenkai);
            console.log(res.data.kekkeiGenkai);
        } catch (error) {
            console.error(error);
        }
        }
        fetchAllKekkeiGenkai();
    },[])

  return (
    <div>
        <div><Navbar/></div>
        <h1>Kekkei Genkai</h1>
        <div className="kekkeiGenkaiWrapper">
        {kekkeiGenkai.map(kekkeiGenkaiItem=>(
                <div className="kekkeiGenkaiItemBox" key={kekkeiGenkaiItem.id}>

                        <div className="akatsukiName">{kekkeiGenkaiItem.name}</div>



                </div>
            ))}
        </div>
    </div>
  )
}

export default KekkeiGenkai
